import { Link } from "react-router-dom";

function Header() {
  return (
    <div className="header">
    <nav>
      <ul>
        <li><Link to='/'>Home</Link></li>
        <li><Link to='/cart'>Cart</Link></li>
        <li><Link to='/cart'>Cart</Link></li>
      </ul>
    </nav>
      <div>
        <h1>E-Commerce Website</h1>
        <p>Get all your products here</p>
      </div>
    </div>
  );
}

export default Header;
